O LATAM Pass, programa de fidelidade oficial da LATAM Airlines, oferece um mundo de possibilidades para você realizar mais rápido a viagem dos sonhos.

Com o App LATAM Pass você tem condições exclusivas em promoções, recebe avisos e notificações. Têm acesso a todos nossos parceiros, acumula pontos e pode resgatar produtos e passagens aéreas. Além disso, você acompanha todas as movimentações em sua conta, seu extrato, vencimento de pontos LATAM Pass e sua Categoria Elite.  

Realize a próxima viagem mais rápido com LATAM Pass!

Com o LATAM Pass, você usa os pontos que ganha no dia a dia com suas compras online, ao abastecer seu veículo e com os gastos no cartão de crédito para curtir férias ou viagens de negócios com todo conforto e comodidade que a LATAM Airlines oferece!

Concentre seus gastos com nossos parceiros, voe sempre com a LATAM Airlines e peça seus pontos LATAM Pass para viajar cada vez mais! Qual seu sonho? O nosso é realizar o seu!

Funcionalidades do aplicativo LATAM Pass: 

- Consulte o saldo de pontos LATAM Pass, movimentações, extrato e pontos a vencer;
- Consulte o status de sua Categoria Elite e Pontos Qualificáveis; 
- Confira todos os parceiros para juntar e resgatar pontos; 
- Resgate passagens aéreas LATAM Airlines e companhias parceiras com mais segurança utilizando o Token para gerar o código de autorização;
- Atualize seu cadastro, gerencie e recupere sua senha;
- Receba alertas e notificações sobre as melhores promoções de passagens aéreas e produtos;

Sobre o programa de fidelidade:

Transfira pontos do seu cartão de crédito, ganhe pontos LATAM Pass comprando em lojas online parceiras ou transferindo pontos de programas parceiros. Junte pontos voando LATAM Airlines e resgate passagens para diversos destinos pelo mundo. Escolha seu destino, nós te levamos. 

Baixe o App LATAM Pass. É grátis!

Cadastre-se e aproveite agora os benefícios e vantagens que só o LATAM Pass oferece! Junte e troque pontos LATAM Pass e comece a planejar a sua próxima viagem! 

Lembre-se: o cadastro é gratuito e com o App LATAM Pass você tem todas as informações da sua conta na palma da mão. Baixe agora!

